window.bookSummaryJSON = "<p>Less than six months ago, my life was twisted and flipped on its side. Things have changed so much; I barely recognize myself anymore. I am no longer an Enforcer. I am no longer a Witch. I no longer hate the Fae. (For the most part)</p> <p>And the sex-on-a-stick gorgeous Fae? </p> <p>He isn't really the Dark Prince. No, he is the father of my children; and with the babies on the way, the land dying and the Mages closing in, alliances will have to be formed if we are all to make it through the war that is coming to our front door. Between warring gods and goddesses, how are any of us supposed to win?</p>"; 
